func BenchmarkSlowQueries(b *testing.B) {
	for _, query := range slowQueries {
		h := newHarness(b, query, slowSchemas)
		b.Run(query.name, func(b *testing.B) {
			for i := 0; i < b.N; i++ {
				h.runSimple(b, query, Explore)
			}
		})
	}
}
